import React, { useEffect, useState } from 'react';
const Doggie = () => {
    const url = "https://dog.ceo/api/breeds/list/all";
    const [dogs, setDogs] = useState();
    useEffect((seq) => {
        fetch(url).then((response) => response.json())
        .then(data => {
            const breeds = Object.keys(data.message);
            return Promise.all(breeds.map(breed => fetch(`https://dog.ceo/api/breed/${breed}/images/random`)));
        })
        .then((resJson) => { setDogs(resJson); console.log(resJson); })
            .catch((err) => console.log('error'))
    }, [])
    return (
        <>
            <div>
                <h2>Dogs:</h2>
                <div className="grid-container">
                    {dogs.map(dog => (
                        <div key={dog.message}>
                            <img src={dog.message} alt={dog.breed} />
                            <div>
                                <h3>{dog.breed}</h3>
                                <p>Lifetime: {dog.lifetime}</p>
                                <p>Food: {dog.food}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </>
    );
}

export default Doggie;
